——————————————————————————. 
C'est simplement la plus grande cascade dont on ai pu faire l'expèrience.
Sa grandeur n'a d'égale que l'effort physique à fournir pour venir à bout des 497 marches qui accompagnent le site. La chute se trouvant au fond d'une gorge, y descendre est aisé, mais gare aux cuisses pour la remontée.💪🏾🦵🏾
Kévin est toujours le premier à se plaindre quand il s'agit de fournir un effort physique lors de la découverte d'un nouveau lieu, mais il est également le premier émerveillé une fois sur place. lol !!! 😁👍🏾💙
